import React, { useEffect, useState } from 'react';

function App() {
  const [backendData, setBackendData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/nastavnici')
      .then((response) => response.json())
      .then((data) => {
        setBackendData(data);
      });
  }, []);

  return (
    <div>
      {typeof backendData.nastavnici === 'undefined' ? (
        <p>Loading...</p>
      ) : (
        backendData.nastavnici.map((nastavnik, i) => {
          return <p key={i}>[nastavnik]</p>;
        })
      )}
    </div>
  );
}

export default App;
